import { View, Text } from 'react-native'
import React from 'react'

export const CircleButton = () => {
  return (
    <View>
      <Text>Circle</Text>
    </View>
  )
}

export const RectButton = () => {
    return (
      <View>
        <Text>Circle</Text>
      </View>
    )
  }
